import React from 'react';
import FaqQues from './FaqQues';
import FaqAns from './FaqAns'

const FaqQueAnsList = () => {
    return (<>
        <li className="list-group-item border-0">
            <FaqQues />
            <FaqAns />
        </li>
    </>)
}

export default FaqQueAnsList;
